import React from 'react';
import { Box, Typography, Avatar, IconButton } from '@mui/material';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import InstagramIcon from '@mui/icons-material/Instagram';
import aboutData from '../data/about';

const About = () => {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        p: 2,
        overflowY: 'auto',
      }}
    >
      <Box
        sx={{
          display: 'flex',
          flexDirection: { xs: 'column', md: 'row' },
          width: { xs: '100%', sm: '90%', md: '70%' },
          boxShadow: 6,
          borderRadius: 4,
          overflow: 'hidden',
        }}
      >
        {/* Sol KÄ±sÄ±m */}
        <Box
          sx={{
            width: { xs: '100%', md: '30%' },
            background: 'linear-gradient(to bottom,rgb(27, 186, 214),rgb(12, 150, 192),rgb(60, 48, 218))',
            display: 'flex',
            flexDirection: 'column',
            alignItems: 'center',
            justifyContent: 'center',
            p: 3,
          }}
        >
          <Avatar
            src="asd.jpg"
            alt="Yakup ÅimÅek"
            sx={{ width: 240, height: 240, mb: 2, border: '3px solid white' }}
          />
          <Typography variant="h5" sx={{ color: 'white', mb: 1, textAlign: 'center' }}>
            Yakup ÅimÅek
          </Typography>
          <Typography variant="subtitle1" sx={{ color: 'white', mb: 2, textAlign: 'center' }}>
            EÄitim TeknoloÄu
          </Typography>
          <Box>
            <IconButton><LinkedInIcon sx={{ color: 'white' }} /></IconButton>
            <IconButton><GitHubIcon sx={{ color: 'white' }} /></IconButton>
            <IconButton><InstagramIcon sx={{ color: 'white' }} /></IconButton>
          </Box>
        </Box>

        {/* SaÄ KÄ±sÄ±m */}
        <Box
          sx={{
            width: { xs: '100%', md: '70%' },
            bgcolor: 'white',
            p: 4,
            display: 'flex',
            flexDirection: 'column',
            justifyContent: 'space-between',
            alignItems:'center',
            borderTopLeftRadius: { xs: 0, md: 40 },
            borderBottomLeftRadius: { xs: 0, md: 40 },
            ml: { xs: 0, md: '-30px' },
            zIndex: 1,
          }}
        >
           <Typography
              variant="h4"
              sx={{
                color: '#001f4d',
                fontWeight: 'bold',
                mb: 3,
                textAlign: 'center',
              }}
            >
              HakkÄ±mda
           </Typography>
          {aboutData.map((item, index) => (
            <Typography key={index} variant="body1" sx={{ color: '#333', mb: 2, textAlign:'center' }}>
              â¢ {item}
            </Typography>
          ))}

          <Box sx={{ display: 'flex', alignItems: 'center', mt: 2, flexWrap: 'wrap' }}>
            <MailOutlineIcon sx={{ color: '#red', mr: 1 }} />
            <Box
              onClick={() => window.open('mailto:yakupsimseke@gmail.com')}
              sx={{
                display: 'flex',
                alignItems: 'center',
                gap: 1,
                px: 2,
                py: 1,
                bgcolor: 'white',
                borderRadius: 20,
                cursor: 'pointer',
                border: '2px solid #7886C7',
                color: 'black',
                transition: '0.3s',
                '&:hover': {
                  bgcolor: '#001f4d',
                  color: 'white',
                },
                mt: { xs: 1, md: 0 },
              }}
            >
              <Typography
               variant="body1"
               sx={{
                 fontWeight: '20px'
                  }}>
                Benimle Ä°letiÅime GeÃ§in
              </Typography>
              <ArrowForwardIosIcon sx={{ fontSize: 16 }} />
            </Box>
          </Box>
        </Box>
      </Box>
    </Box>
  );
};

export default About;
